import React from 'react'
import axios from 'axios';
import { render } from '@testing-library/react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import { Button, Row, Col, Container, Form, ListGroup, Group, Label, Control, Text } from 'react-bootstrap';
import Confetti from "react-confetti";
import FigureImage from "react-bootstrap/esm/FigureImage";




export default class TodoList extends React.Component {
    state = {
        todos: []
    }

    componentDidMount() {
        axios.get(`http://localhost:5000/todolist`)
            .then(res => {
                const todos = res.data;
                this.setState({ todos });
            })
    }

    render() {
        return (
            <ul>
                <ListGroup.Item>
                    <Row>
                        {props.everythingDone}
                        <Col>
                            <input className="checkboxes" id="todo-0" type="checkbox" />
                        </Col>
                        <Col>
                            {/* <Form.Group controlID="Text01"> */}
                            {/* <Form.Control type="input"></Form.Control> */}
                            {/* </Form.Group> */}
                            {this.state.todos.map(todolist => <li>{todolist.todo}</li>)}
                            {/* {props.name} */}
                        </Col>
                        <Col>
                            <Form.Group controlID="Check02">
                                {/* <Button variant="success">DONE</Button> */}
                                <Button  variant="primary">EDIT</Button>
                                <Button  variant="danger">DELETE</Button>
                            </Form.Group>
                        </Col>
                    </Row>
                </ListGroup.Item>
            </ul>
        )
    }
}
